import React, {Component} from 'react';

class Info extends Component {
    render() {
        return(
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Amount</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Aspirin</td>
                            <td>150mg</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Info;
